import React from "react";
import { Avatar } from 'antd';
import { UserOutlined } from '@ant-design/icons';
function AppHeader() {

  return (
    <>
      <nav class="navbar navbar-light  px-4" style={{ backgroundColor:'#001529',
        borderLeft:'1px solid linear-gradient(87deg, #5e72e4 0, #825ee4 100%) !important;'}}>
        <h3 class="navbar-brand text-white">Dashboard</h3>
        <form class="form-inline">
         
          <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" size={45} icon={<UserOutlined />} />
        </form>
      </nav>
      </>
  );
}

export default AppHeader;
